    data: |
      SELECT + - col1 AS col1, - 94 / col1 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT NULL IS NOT NULL;
  - name: tab0

outputs:
  - name: q9733.out
    data: |
      -1	-94
      -21	-4
      -81	-1
